import React from 'react';
import ToDoView from "./to-do-view";
import ToDoTask from "./to-do-task";

const ToDoItem = ({className}) => {
    if(className == 'completed') {
        return <li><ToDoView/>></li>
    }
    else if(className == 'editing') {
        return (<li>
                <ToDoView/>
                <ToDoTask/>
             </li>);
    }
    else {
        return  <li><ToDoView/>></li>
    }



};

export default ToDoItem;
